import React from "react";
import Card from "./Card";

const ListCard = robots => {
  const cardComponente = robots.map((usuario, i) => {
    return (
      <Card id={robots[i].id} name={robots[i].nombre} email={robots[i].email} />
    );
  });
  return (
    <div>
      <Card id={robots[0].id} name={robots[0].nombre} email={robots[0].email} />
      <Card id={robots[1].id} name={robots[1].nombre} email={robots[1].email} />
      <Card id={robots[2].id} name={robots[2].nombre} email={robots[2].email} />
    </div>
  );
};

export default ListCard;
